script: |
  super -f text -I q1023.spq | sort > q1023.out

inputs:
  - name: q1023.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT ( NOT col0 NOT BETWEEN - col1 * - ( - - 41 ) + col1 + col1 AND - ( - 43 ) );
  - name: tab2

outputs:
  - name: q1023.out
    data: |
      46	51	23
      64	77	40
      75	67	58
